
create table MOCK_DATA (
    id INT,
    first_name VARCHAR(50),
    last_name VARCHAR(50),
    email VARCHAR(50),
    gender VARCHAR(50),
    ip_address VARCHAR(20),
    city VARCHAR(50),
    country VARCHAR(50),
    avatar VARCHAR(150),
    car_make VARCHAR(50),
    car_model VARCHAR(50),
    car_year VARCHAR(50)
);

